import React from 'react';
import { 
  Message, 
  VideoCall, 
  Note, 
  CalendarToday 
} from '@mui/icons-material';

// Re-export commonly used icons with consistent styling
export const MessageIcon = Message;
export const VideoIcon = VideoCall;
export const NoteIcon = Note;
export const CalendarIcon = CalendarToday;
